import { DataTypes, Model } from 'sequelize';
import crypto from 'crypto';
import sequelize from '../../services/sequelize';
import {crypt} from "../../services/passport";
import { password } from '../../services/passport';

const roles = ['user', 'admin'];
const DEFAULT_ROLE = 'user';

class User extends Model {
  // Vous pouvez ajouter des méthodes spécifiques à votre modèle ici
  view(full) {
    const view = {};
    let fields = ['id', 'name', 'picture'];

    if (full) {
      fields = [...fields, 'email', 'createdAt'];
    }

    fields.forEach((field) => {
      view[field] = this[field];
    });

    return view;
  }

}

User.init(
    {
      email: {
        type: DataTypes.STRING,
        allowNull: false,
        unique: true,
        validate: {
          isEmail: true,
        },
      },
      password: {
        type: DataTypes.STRING,
        allowNull: false,
        validate: {
          len: [6, 255],
        },
      },
      name: {
        type: DataTypes.STRING,
        validate: {
          len: [0, 255],
        },
      },
      role: {
        type: DataTypes.STRING,
        allowNull: false,
        defaultValue: DEFAULT_ROLE,
        validate: {
          isIn: {
            args: [roles],
            msg: 'Le rôle doit être "user" ou "admin"',
          },
        },
      },
      picture: {
        type: DataTypes.STRING,
        validate: {
          len: [0, 255],
        },
      },
    },
    {
      sequelize,
      modelName: 'User',
      timestamps: true,
      underscored: true,
    }
);

// Hook avant l'enregistrement (beforeSave)
User.beforeSave(async (user, options) => {
  if (!user.picture || user.picture.indexOf('https://gravatar.com') === 0) {
    const hash = crypto.createHash('md5').update(toString(user.email)).digest('hex');
    user.picture = `https://gravatar.com/avatar/${hash}?d=identicon`;
  }

  if (!user.name) {
    user.name = user.email.replace(/^(.+)@.+$/, '$1');
  }

  return toString(user.email);
});

// Hook avant la création d'un utilisateur (beforeCreate)
User.beforeCreate(async (user, options) => {
  if (user.password) {
    const rounds = process.env.NODE_ENV === 'test' ? 1 : 9;
    user.password = await crypt(user.password,rounds);
  }
});
export default User;

